import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import ComprarProducto from "./components/ComprarProducto"; // Asegúrate de importar el componente
import Menu from "./components/Menu";  // Si tienes un menú principal

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Menu />} /> {/* Si tienes un menú */}
        <Route path="/comprar" element={<ComprarProducto />} /> {/* Ruta para comprar producto */}
      </Routes>
    </Router>
  );
}

export default App;
